import React from 'react'
import './Navbar.css'

const Navbar = () => {
    return (
        <div className='Navbar'>
            <div>My profile</div>
            <div>Feed</div>
            <div>Messages</div>
            <div>Videos</div>
            <div>Settings</div>
        </div>
    )
}

export default Navbar;
